package string.mutable;

public class Coures {
private String name;
public Coures() {
    // TODO Auto-generated constructor stub
}
public String getName() {
    return name;
}

public void setName(String name) {
    this.name = name;
}
@Override
public String toString() {
    return "Coures [name=" + name + "]";
}

}
